  false,\n\t\"url\": null,\n\t\"notes\": \" n        Early on, MCC and the evaluator
  decided to focus the Urban and Peri-Urban Water evaluation on Package 1 infrastructure,
  which benefited Maseru and Mazenod.  MCC later decided to expand the scope of this
  evaluation for two reasons.  First, four additional packages of infrastructure were
  provided throughout Lesotho, and that work needed to be assessed.  Second, Package
  1 infrastructure is actually connected to the Metolong Dam activity, which will
  significantly increase the volume of water entering the Urban and Peri-Urban Water
  network.  Rather than contract for separate evaluations of these related investments,
  MCC decided to cancel the existing evaluation and pursue one comprehensive evaluation
  of the Metolong Dam and Urban and Peri-Urban Water activities.n      \",\n\t\"license_title\":
